/*Checkboxes styles taken from https://codepen.io/valerypatorius/pen/oXGMGL?q=custom+checkbox&limit=all&type=type-pens*/
input[type="checkbox"] { display: none; }

input[type="checkbox"] + label {
  display: block;
  position: relative;
  padding-left: 28px;
  margin-bottom: 20px;
  font: 18px/20px 'Oswald';
  color: black;
  cursor: pointer;
}


input[type="checkbox"] + label:before {
  content: '';
  display: block;
  width: 20px;
  height: 20px;
  border: 1.5px solid #6cc0e5;
  position: absolute;
  left: 0;
  top: 0;
  opacity: .6;
  transition: all .12s, border-color .08s;
}

input[type="checkbox"]:checked + label:before {
  width: 10px;
  top: -5px;
  left: 5px;
  border-radius: 0;
  opacity: 1;
  border-top-color: transparent;
  border-left-color: transparent;
  transform: rotate(45deg);
}
/*Button styles taken from https://codepen.io/CTNieves/pen/pbLGZW*/
.btn {
  position: relative;
  padding-left: 15px;
  padding-right: 15px;
  padding-bottom: 5px;
  padding-top: 5px;
  line-height: 64px;
  transition: all 0.3s;
  span {
    transition: all 0.3s;
    tranform: scale(1, 1);
  }
}

.btn::before, .btn::after {
  content: '';
  position: absolute;
  transition: all 0.3s;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 1;
}
.btn-three::before {
  opacity: 0;
  background: #ffffff;
  transform: scale(1, 0.1);
}

.btn-three:hover::before {
  opacity: .6;
  transform: scale(1, 1);
}

.btn-three::after {
  transition: all 0.3s;
  border: 1px solid #42ecc4;
}

.btn-three:hover::after {
  transform: scale(1, .1);
  opacity: 0;
}
